	console.log("data", props.data);

	return (
		<>
			<p>{props.data.name}</p>
			<img
				src={props.data.img}
				alt={props.data.name}
				width="230"
				// height="600"
			/>
			<div>
				<p style={{ float: "left" }}>Free</p>
				<p style={{ float: "right" }}>0</p>
			</div>
			<div>{props.data.name}</div>
			<p>{props.data.name}</p>
			<button>Booking</button>
		</>
	);
};
export default ItemList;
